import React from 'react';
import { BrowserRouter as Router, Route} from 'react-router-dom';
import { Home } from './layout/Home';

import { GlobalProvider } from './context/GlobalState';

import './App.css';

const App = () => {
  return (
    <GlobalProvider>
      <Router>
        <Route exact path='/' component={Home} />
      </Router>

    </GlobalProvider>
  );
}

export default App;
